import React, { useState } from 'react';

const Equipe= (props) => {

  return (
    <div>
        {props.arrEquipe.map((item, index) => (
            props.arrEquipe[index].map((item, indexEquipier) => (
                <p key={indexEquipier}>{props.arrEquipe[index][indexEquipier]}</p>
            ))
        ))}
    </div>
  );
}

export default Equipe;
